export default function Slider({data}) {

    const value = 100;

    return (
        <ReactSlider
        className='mySlider'
        trackClassName="mySlider-track"
        thumbClassName="mySlider-thumb"
        markClassName="mySlider-mark"
        defaultValue={100}
        marks={20}
        max={200}
        min={0}
        value={data}
        onChange={() => data()}
        />
    );
}
